import React from "react";

function JobInfo({ formData, setFormData }) {
    return (
        <div className="sign-up-container">
            <input
                type="text"
                placeholder="job title...."
                value={formData.jobbTitle}
                onChange={(event) =>
                    setFormData({ ...formData, jobbTitle: event.target.value })
                }
            />
            <input
                type="text"
                placeholder="companyTitle...."
                value={formData.companyTitle}
                onChange={(event) =>
                    setFormData({ ...formData, companyTitle: event.target.value })
                }
            />
           
        </div>


    );
}

export default JobInfo
